import React from 'react';
import styled from 'styled-components';

const NavBar = () => {
    return (
        <div className='NavBar'>
            <TopMenu>
                    <div>로고</div>
            </TopMenu>
        </div>
    )
}

export default NavBar;

const TopMenu = styled.div`
    display: flex;
    background-color: inherit;
    margin-right: 1em;
    align-items: center;
    justify-content: space-between;
`
